    /**
     * Get getVistasEstablecimientosTablet
     *
     * @return \Doctrine\Common\Collections\Collection
     */    
    public function getVistasEstablecimientosTablet()
    {
        $establecimiento["estado"]=$this->getEstado();
        $establecimiento["actuaciones"]=$this->getActuaciones();
        $establecimiento["razones_sociales"]=$this->getRazonesSociales();
        $establecimiento["rubro_principal"]=$this->getRubroPrincipal();
        $establecimiento["rubro"]=$this->getRubro();
        $establecimiento["id"]=$this->getId();
        $establecimiento["ex_e_e_s_s"]=$this->getExEESS();
        return $establecimiento;
    }

